import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwIcon from 'viewmodel/AwIconViewModel';




/*
ctx imports
*/

const ctxImportObj = {  };




/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {},
    "data": {},
    "conditions": {},
    "onEvent": [],
    "props": {
        "vmo": {
            "type": "object"
        }
    },
    "lifecycleHooks": {},
    "_viewModelId": "AwBpmnCell",
    "_uniqueViewModelId": "AwBpmnCell",
    "ctx": {}
};

/*
<div class='aw-bpmn-cell aw-image-cell-container aw-layout-flexRow'>
    <!--large thumbnail-->
    <div class='aw-bpmn-thumbnail'>
        <aw-icon class='aw-base-icon' icon-id='{{props.vmo.props.icon.uiValue}}'></aw-icon>
    </div>
    <div class='aw-bpmn-text'>
        <!--cell list content-->
        <div class='aw-widgets-cellListCellContent' title='{{props.vmo.props.title.uiValue}}'>
            {{props.vmo.props.title.uiValue}}
        </div>
    </div>
</div>

*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <div className="aw-bpmn-cell aw-image-cell-container aw-layout-flexRow">
        <div className="aw-bpmn-thumbnail">
            <AwIcon className="aw-base-icon" iconId={AwParseService.instance( "props.vmo.props.icon.uiValue" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
            </AwIcon>
        </div>
        <div className="aw-bpmn-text">
            <div className="aw-widgets-cellListCellContent" title={AwParseService.instance( "props.vmo.props.title.uiValue" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}>
                {AwParseService.instance( "props.vmo.props.title.uiValue" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}
            </div>
        </div>
    </div>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
